INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('6360','1177','103','779','10/31/2012 12:00:00 AM','1','Email','Last week I totaled 3 and half hours. One hour on Tuesday the 23rd and 2 hours on Thursday the 26th. This week I have completed 1 hour and will complete 2-3 hours this Thursday the 1st. As before we have helped children with their homework and provided activities and games for the children to do. One thing that has been problematic is not being informed of schedule changes. The public school break schedule change lasted until yesterday and regular hours 3-6pm are not in effect until today. We were misinformed and were unaware only allowing us one hour yesterday. For the future, the schedule needs to be given out ahead of it to prevent this from happening.','Fall 2012',null,null,null);
