INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('5998','618','126','810','10/25/2012 12:00:00 AM','0','Email','Hello Victoria,  I had emailed the coordinator at ACP numerous times and heard no response to begin my volunteering because I had to change my work schedule, which was extremely difficult, to coordinate a day to go volunteer. After hearing no response I decided I was just going to show up one afternoon to the organization to discuss the times I would come in to volunteer and begin completing my hours, but unfortunately I got extremely sick. I had lost my voice for over a week and just recently got it back two days ago and am now recovering from being ill.However, being so ill caused me to fall even more behind on completing hours because it wouldn''t have been right to volunteer at the organization and put those individuals at risk of getting sick. Now, that I''m better I''m going to ACP this week to begin my hours.   Sincerely, Gina Marogil              PROBLEM STUDENT! UGH. talked to jonathan about it. ','Fall 2012',null,null,null);
